import React from 'react';
import '../App.css';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import Grid from '@mui/material/Grid';
// import axios from 'axios';
import {
  Button,
  CssBaseline,
  TextField,
  Box,
  Typography,
  Container,
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const defaultTheme = createTheme();

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();

  // this should save the experience selected.
  const chooseExperience = async (e) => {
    e.preventDefault();
    try {
      navigate('/projects')
    } catch (err) {
      alert(err.response.data.error);
    }
  };

  return (
    <Grid sx={{ flexGrow: 1, height: "100vh" }} columnSpacing={2}>
      <Grid item xs={4} sx={{ border: "solid 1px black" }}>
        Premium
      </Grid>
      <Grid item xs={4} sx={{ border: "solid 1px black" }}>
        Plus
      </Grid>
      <Grid item xs={4} sx={{ border: "solid 1px black" }}>
        Base
      </Grid>
    </Grid>
  )
}

export default Experiences;
